import { Component } from '@angular/core';
import { SharedDataService } from '../shared-data.service';

@Component({
  selector: 'app-thank-you',
  standalone: true,
  templateUrl: './thank-you.component.html',
  styleUrls: ['./thank-you.component.css']
})
export class ThankYouComponent {
  clientData: any;
  schedulingData: any;

  constructor(private sharedDataService: SharedDataService) {
    this.clientData = this.sharedDataService.getClientData(); // Retrieve client data
    this.schedulingData = this.sharedDataService.getSchedulingData(); // Retrieve scheduling data
    console.log('Scheduling Data:', this.schedulingData); // Debugging
  }
}
<h1>Thank You, {{ clientData?.fullName }}!</h1>
<h4>We have received your information and look forward to meeting with you on your selected date:
     {{schedulingData?.appointmentDate}}.</h4>
